import React from "react";
import Play from "./components/play";
import Users from "./components/users";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      nameOne: "",
      nameTwo: "",
      cssOneX: "",
      cssOneO: "",
      cssTwoX: "",
      cssTwoO: "",
      selectPage: true,
    };
  }
  render() {
    return (
      <div>
        {this.state.selectPage ? <Users /> : <Play />}
        <h1>{this.props.sel}</h1>
      </div>
    );
  }
}

export default App;
